import React from 'react'

let ProfileStatusWithHooks = (props) => {
        return(
            <>
                <div>
                    {true
                    ?<span>{!props.status?'Статуса нет':props.statusd}</span>
                    :<input autoFocus={true}  ></input>}
                </div>
            </>
        )
    }
export default ProfileStatusWithHooks;
